import { Reason, User } from "../../App";
import { PDFDocument, StandardFonts } from "pdf-lib";

export async function generateCertificateAsBase64(user: User, reason: Reason) {
  const rawCertificateAsBase64 =
    '';

  const pdfDoc = await PDFDocument.load(rawCertificateAsBase64);
  const pages = pdfDoc.getPages();
  let page1 = pages[0];

  const font = await pdfDoc.embedFont(StandardFonts.Helvetica);
  const drawText = (text: string, x: number, y: number, size: number = 11) => {
    page1.drawText(text, { x, y, size, font })
  };

  drawText(`${user.firstName} ${user.lastName}`, 123, 686);
  drawText(user.birthday, 123, 661);
  drawText(user.birthLocation, 92, 638);
  drawText(`${user.address} ${user.zipCode} ${user.town}`, 134, 613);
  if (reason.reasons.includes('travail')) {
    drawText('x', 77, 527, 19)
  }
  if (reason.reasons.includes('courses')) {
    drawText('x', 77, 478, 19)
  }
  if (reason.reasons.includes('sante')) {
    drawText('x', 77, 436, 19)
  }
  if (reason.reasons.includes('famille')) {
    drawText('x', 77, 400, 19)
  }
  if (reason.reasons.includes('sport')) {
    drawText('x', 77, 345, 19)
  }
  if (reason.reasons.includes('judiciaire')) {
    drawText('x', 77, 298, 19)
  }
  if (reason.reasons.includes('missions')) {
    drawText('x', 77, 260, 19)
  }

  return pdfDoc.saveAsBase64();
}
